class Solution:
    def findAnagrams(self, s: str, p: str):
        op_list = []
        p_hash = [0] * 26
        s_hash = [0] * 26

        

        for i in range(len(s)-len(p)+1) :
            print("list check :", s[i:i+len(p)])
            if self.isAnagram(s[i:i+len(p)],p) :
                op_list.append(i)

        return op_list

    def isAnagram(self, s, p) :
        s_list = [i for i in s]
        s_list.sort()
        print("s_list", s_list)
        p_list = [i for i in p]
        p_list.sort()
        return s_list == p_list



